import React, {Component} from "react";
import Button from "@material-ui/core/Button";
import {AppBar, Container, emphasize, Toolbar, Typography} from "@material-ui/core";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from '@material-ui/icons/Menu';
import Breadcrumbs from '@material-ui/core/Breadcrumbs'
import HomeIcon from '@material-ui/icons/Home';
import Chip from "@material-ui/core/Chip";
import withStyles from "@material-ui/core/styles/withStyles";
import SupervisorAccountIcon from '@material-ui/icons/SupervisorAccount';
import Box from "@material-ui/core/Box";

const useStyles = theme => ({
    menuButton: {
        marginRight: theme.spacing(2),
    }
});

const StyledBreadcrumb = withStyles((theme) => ({
    root: {
        backgroundColor: theme.palette.grey[100],
        height: theme.spacing(3),
        color: theme.palette.grey[800],
        fontWeight: theme.typography.fontWeightRegular,
        '&:hover, &:focus': {
            backgroundColor: theme.palette.grey[300],
        },
        '&:active': {
            boxShadow: theme.shadows[1],
            backgroundColor: emphasize(theme.palette.grey[300], 0.12),
        },
    },
}))(Chip);

function handleClick(event) {
    event.preventDefault();
    console.info('You clicked a breadcrumb.');
}


export class HeaderComponent extends Component{
    constructor(props) {
        super(props);
        this.state ={

        }
    }

    render() {
        const {classes} = this.props;
        return (
            <AppBar position = "fixed">
                <Container fixed>
                    <Toolbar>
                        <IconButton edge ="start" color ="inherit" aria-label ="menu">
                            <MenuIcon />
                        </IconButton>
                        <Breadcrumbs aria-label="breadcrumb">
                            <StyledBreadcrumb
                                component="a"
                                href="#"
                                label="BooksStore"
                                icon={<HomeIcon fontSize="small" />}
                                onClick={handleClick}
                            />
                            <StyledBreadcrumb component="a" href="#" label="Избранное" onClick={handleClick} />
                            <StyledBreadcrumb component="a"
                                              href="#"
                                              label="Администратор"
                                              icon={<SupervisorAccountIcon fontSize="small"/>}
                                              onClick={handleClick} />
                        </Breadcrumbs>
                        <div className={classes.menuButton}>
                        <Button color="inherit">Регистрация</Button>
                        <Button color="inherit">Войти</Button>
                        <Button color="inherit">Выйти</Button>
                        </div>
                    </Toolbar>
                </Container>
            </AppBar>
        )
    }
}
export default withStyles(useStyles)(HeaderComponent)
